import React, { Component } from 'react';
import { Table } from 'reactstrap';



const TableHeader = () => {
    return (
        <thead>
            <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Job</th>
            </tr>
        </thead>

    );
}
function TableBody(props) {
    const rows = props.charactersData.map((row) => {
        return (
            <tr keys={row.id}>
                <td>{row.name}</td>
                <td>{row.job}</td>
            </tr>
        )
    });

    return <tbody>{rows}</tbody>
}

class Table1 extends Component {
    render() {
        const { charactersData } = this.props.characterData;
        return (
            <Table>
                <TableHeader />
                <TableBody charactersData={charactersData} />

            </Table>
        );
    }
}

export default Table1;
